    [],nt"num_tags": 4,nt"name": "crescent-lake-national-wildlife-refuge-and-north-platte-national-wildlife-refuge-1976",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Crescent
    Lake National Wildlife Refuge outlines Refuge accomplishments during 1976. The report
    begins by describing the climate and habitat conditions in the Refuge, as well as
    the land acquisition program and system status. The construction and maintenance
    section describes physical developments, maintenance, and wildfires. The habitat
    management section discusses grasslands, wetlands, forest lands, wilderness and
    special areas, and easements for waterfowl management. Wildlife- including endangered
    and threatened species, migratory birds, big game animals, upland game birds, predators,
    furbearers, rodents, raptors, fish, and reptiles- are discussed. The public relations
    sections describes recreational uses and enforcement. Field investigations, items
    of interest, and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
